import React from "react";

function Navbar() {
  return (
    <div>
      <nav className="navbar navbar-light bg-dark md-5">
        <div className="container">
          <div classNmae="navbar-header">
            <a
              className="navbar-brand text-white text-lg brand-text"
              href="index.html"
            >
              MoviesSeriesInfo
            </a>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
